from tkinter import *
from tkinter import filedialog, ttk
from tkinter import messagebox
from shutil import copyfile
import os 
username = os.getlogin()
import threading 
import webbrowser


def onCheckPic():
	print(f"Is radiobutton pic checked? {if_pic.get()}")

def onCheckSong():
	print(f"Is radiobutton song checked? {if_song.get()}")
        
def onCheckBg():
	print(f"Is radiobutton Bg checked? {if_bg.get()}")

def selectFolder1():
    str1 = f"C:/Users/{username}/AppData/Local/osu!"
    folder_path = filedialog.askdirectory(title="select", initialdir = str1)
    s1.set(folder_path)

def selectFolder2():
    str1 = f"C:/Users/{username}/Documents"
    folder_path = filedialog.askdirectory(title="select", initialdir=str1)
    s2.set(folder_path)

def worker():
    start_osu_dir = s1.get() #  the osu directory
    target_dir = s2.get() # the target directory

    pic = if_pic.get() # transfer the images?
    song = if_song.get() # transfer the songs?
    bg = if_bg.get() # transfer the bg imgs?

    


    if not os.path.exists((target_dir + "/OSU file is here")):
        target_dir = target_dir + "/OSU file is here" 
        os.mkdir(target_dir)
    else:
        target_dir = target_dir + "/OSU file is here" 

    song = if_song.get()
    if not os.path.exists((target_dir + "/OSU songs")):
        if song: os.mkdir((target_dir + "/OSU songs"))
    if not os.path.exists((target_dir + "/OSU picture")):
        if pic or bg: os.mkdir((target_dir + "/OSU picture"))

    if bg:
        bg_dir = start_osu_dir + "/Data/bg"
        for root, dirs, files in os.walk(bg_dir): 
            for f in files:
                copyfile(os.path.join(root, f), (target_dir + f"/OSU picture/{f}.jpg"))
            break
    if not song and not pic: 
        progress.set(100)
        messagebox.showinfo(title="message", message=f"The transfer is over.\nYou can found the result in {target_dir}")
        webbrowser.open(target_dir) 
        os._exit(os.EX_OK)

    start_osu_dir += "/Songs"
    for root, dirs, files in os.walk(start_osu_dir): 
        # using for-loop just for getting the list of all the direcctory in my folder. (not for the loop ;)
        
        if 0 != len(dirs): num = s = 100/len(dirs)
        else: num = s = 100 # progress bar cal calculation

        for f in dirs: # for all the song folders
            for root1, dirs1, files1 in os.walk(os.path.join(root, f)):
                counter = 0
                for name in files1:
                    c = name.split(".")
                    if song and c[-1] == "mp3":
                        print(c)
                        copyfile(os.path.join(root1, name), (target_dir + f"/OSU songs/{f}.mp3"))
                    if pic and (c[-1] == "jpg" or c[1] == "png"):
                        if name != "pause-overlay":  
                            if name.find('default') != -1 or name.find('followpoint') != -1 or name.find('circle') != -1 or name.find('epilepsy') != -1 or name.find('hit') != -1  or name.find('score') != -1 or name.find('slider') != -1 or name.find('spinner') != -1  or name.find('arrow') != -1 or name.find('cursor') != -1 or name.find('go') != -1  or name.find('pause') != -1 or name.find('play') != -1 or name.find('lighting') != -1 or name.find('point') != -1 or name.find('star') != -1 or name.find('count') != -1:
                                continue
                        print(c)
                        counter+=1
                        if c[-1] == "jpg":
                            copyfile(os.path.join(root1, name), (target_dir + f"/OSU picture/{f}[{counter}].jpg"))
                        if c[-1] == "png":
                            copyfile(os.path.join(root1, name), (target_dir + f"/OSU picture/{f}[{counter}].png"))
                break
            
            progress.set(num)
            num += s
        break 
    messagebox.showinfo(title="message", message=f"The transfer is over.\nYou can found the result in {target_dir}")
    webbrowser.open(target_dir)
    os._exit(os.EX_OK)

def copyFile():
    progress.set(0)
    start_osu_dir = s1.get()
    target_dir = s2.get()
    pic = if_pic.get()
    song = if_song.get()
    tmp = start_osu_dir.split("/") 
    
    if not target_dir or not start_osu_dir:
        messagebox.showerror(title="ERROR", message="you dont choose the target directory or the osu directory")
        return 1
    if  not pic and not song and not bg:
        messagebox.showerror(title="ERROR", message="you dont select what you want to transfer. \n-------- picture or/and songs --------")
        return 1
    if tmp[-1] != "osu!":
        tmp = '"'+tmp[-1]+'"'
        if not messagebox.askyesnocancel(title="Alert", message=f"you choose to copy from {tmp} \nand not from osu's folder  \nare you sure you want to continue?"):
            return 1
    tmp =  "you are going to copy all "
    if pic: 
        tmp += "the picture "
        if song: tmp += "and all "
    if song: tmp += "the song "
    tmp += f"\nfrom {start_osu_dir} \nto {target_dir}."
    if not messagebox.askyesnocancel(title="Alert", message=f"{tmp}\ndo you want to continue"):
        return 1

    t = threading.Thread(target=worker, args=[])
    t.start() 
    
    return 0

root = Tk(className="Get files from osu!")
root.geometry('1200x424')
icon_img_dot_png_in_base64 = "" 

#the icon (image.png) in base64
