root.wm_iconphoto(False, photo)


encoded_bg_img_in_base64 = ""

# Embed image in the code
#bg = PhotoImage(file="background_img.png")
bg = PhotoImage(data=encoded_bg_img_in_base64)
Label(root, image=bg).place(x=0, y=0)#Show image using label
#----


Label(root, font=("David", 25), text="select what do you want to copy:").pack(side="top")
if_pic = BooleanVar()
if_song = BooleanVar()
if_bg = BooleanVar()
c1 = Checkbutton(root, font=("David", 16), text='copy all picture',variable=if_pic, onvalue=True, offvalue=False, command=onCheckPic).pack()
c2 = Checkbutton(root, font=("David", 16), text='copy all songs',variable=if_song, onvalue=True, offvalue=False, command=onCheckSong).pack()

c3 = Checkbutton(root, font=("David", 16), text='copy the seasonal backgrourd pic',variable=if_bg, onvalue=True, offvalue=False, command=onCheckBg).pack()

Button(root, font=("David", 18), text="Select the osu folder", command= selectFolder1).pack()
s1 = StringVar()
Label(root, font=("David", 18), textvariable=s1).pack()

Button(root, font=("David", 18), text="Select the target folder", command= selectFolder2).pack()
s2 = StringVar()
Label(root, font=("David", 18), textvariable=s2).pack()

Label(root, font=("David", 18), bg="yellow", text="Make sure that you select the folder and what you want to copy befor you click on the start button").pack()

Label(root).pack()

Button(root, font=("David", 23), fg="red", text="start transfer", command= copyFile).pack()

Label(root).pack()
progress = IntVar()
pb = ttk.Progressbar(root, orient='horizontal',variable=progress, length=1000).pack()
Label(root).pack()

